import React from 'react';

export default function TeamHeader({ teamName, season , teamBackgroundColor, teamTextColor}){
  const style = {
    "backgroundColor":teamBackgroundColor,
    "color":teamTextColor
  }
  return(
    <header style={style}>
      <h1>{teamName}</h1>
      <h1>{season}</h1>
    </header>
  );
}
